import React from 'react';
import './testApp.scss';
import UserProfile from './testComponents/testUser-profile/testUser-profile.component';
import UserList from './testComponents/testUser-List/testUser-list.component';

function TestApp(){
    return (
        <div className="App">
            <UserList 
                dataSource ='https://jsonplaceholder.typicode.com/users' />
            <UserProfile 
                name='John Dow' 
                email='jd@hotmail.com'
                dataSource ='https:jsonplaceholder.typicode.com/posts'/>
        </div>
    );
}
export default TestApp;
